// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title BusinessRating
 * @dev A decentralized system for verified business ratings based on actual transactions
 */
contract BusinessRating {
    struct Business {
        string name;
        bool isRegistered;
        uint256 totalRatings;
        uint256 ratingsCount;
    }

    struct Transaction {
        address customer;
        address business;
        uint256 timestamp;
        bool isRated;
    }

    struct Rating {
        address customer;
        address business;
        uint8 score; // 1-5 star rating
        string comment;
        uint256 timestamp;
    }

    mapping(address => Business) public businesses;
    mapping(address => mapping(address => Transaction[])) public transactions;
    mapping(address => mapping(address => Rating[])) public ratings;

    event BusinessRegistered(address indexed business, string name);
    event TransactionRecorded(
        address indexed customer,
        address indexed business
    );
    event RatingSubmitted(
        address indexed customer,
        address indexed business,
        uint8 score
    );

    /**
     * @dev Register a new business
     * @param _name Business name
     */
    function registerBusiness(string memory _name) external {
        require(
            !businesses[msg.sender].isRegistered,
            "Business already registered"
        );

        businesses[msg.sender] = Business({
            name: _name,
            isRegistered: true,
            totalRatings: 0,
            ratingsCount: 0
        });

        emit BusinessRegistered(msg.sender, _name);
    }

    /**
     * @dev Record a transaction between customer and business
     * @param _business Business address
     */
    function recordTransaction(address _business) external {
        require(businesses[_business].isRegistered, "Business not registered");

        transactions[msg.sender][_business].push(
            Transaction({
                customer: msg.sender,
                business: _business,
                timestamp: block.timestamp,
                isRated: false
            })
        );

        emit TransactionRecorded(msg.sender, _business);
    }

    /**
     * @dev Submit a rating for a business based on a previous transaction
     * @param _business Business address
     * @param _score Rating score (1-5)
     * @param _comment Rating comment
     * @param _transactionIndex Index of the transaction to rate
     */
    function submitRating(
        address _business,
        uint8 _score,
        string memory _comment,
        uint256 _transactionIndex
    ) external {
        // Validation checks
        require(businesses[_business].isRegistered, "Business not registered");
        require(_score >= 1 && _score <= 5, "Score must be between 1 and 5");

        Transaction[] storage customerTransactions = transactions[msg.sender][
            _business
        ];
        require(
            customerTransactions.length > _transactionIndex,
            "Transaction does not exist"
        );

        // Get transaction
        Transaction storage transaction = customerTransactions[
            _transactionIndex
        ];

        // Verify transaction has not been rated
        require(!transaction.isRated, "Transaction already rated");

        // Mark as rated
        transaction.isRated = true;

        // Create and store rating
        ratings[msg.sender][_business].push(
            Rating({
                customer: msg.sender,
                business: _business,
                score: _score,
                comment: _comment,
                timestamp: block.timestamp
            })
        );

        // Update business rating metrics
        Business storage business = businesses[_business];
        business.totalRatings += _score;
        business.ratingsCount += 1;

        emit RatingSubmitted(msg.sender, _business, _score);
    }

    /**
     * @dev Get average rating for a business
     * @param _business Business address
     * @return Average rating (1-5)
     */
    function getAverageRating(
        address _business
    ) external view returns (uint256) {
        Business memory business = businesses[_business];
        if (business.ratingsCount == 0) {
            return 0;
        }
        return business.totalRatings / business.ratingsCount;
    }

    /**
     * @dev Get transaction count between a customer and business
     * @param _customer Customer address
     * @param _business Business address
     * @return Number of transactions
     */
    function getTransactionCount(
        address _customer,
        address _business
    ) external view returns (uint256) {
        return transactions[_customer][_business].length;
    }

    /**
     * @dev Get business details
     * @param _business Business address
     * @return name The name of the business
     * @return totalRatings Sum of all ratings
     * @return ratingsCount Number of ratings submitted
     */
    function getBusinessDetails(
        address _business
    )
        external
        view
        returns (string memory name, uint256 totalRatings, uint256 ratingsCount)
    {
        Business memory business = businesses[_business];
        return (business.name, business.totalRatings, business.ratingsCount);
    }

    /**
     * @dev Get a specific rating by a customer for a business
     * @param _customer Customer address
     * @param _business Business address
     * @param _ratingIndex Index of the rating
     * @return score The rating score (1-5)
     * @return comment The rating comment
     * @return timestamp When the rating was submitted
     */
    function getRating(
        address _customer,
        address _business,
        uint256 _ratingIndex
    )
        external
        view
        returns (uint8 score, string memory comment, uint256 timestamp)
    {
        require(
            ratings[_customer][_business].length > _ratingIndex,
            "Rating does not exist"
        );

        Rating memory rating = ratings[_customer][_business][_ratingIndex];
        return (rating.score, rating.comment, rating.timestamp);
    }
}

